package grh

import (
	"encoding/json"
	"fmt"
)

type Group struct {
	ID            int    `json:"id"`
	CorpId        string `json:"corpId"`
	GroupName     string `json:"groupName"`
	ParentGroupId int    `json:"parentGroupId"`
	ParentStr     string `json:"parentStr"`
	GroupId       int    `json:"groupId"`
	IsZybApp      int    `json:"isZybApp"`
	OperaterName  string `json:"operaterName"`
	CreateTime    int    `json:"createTime"`
	UpdateTime    int    `json:"updateTime"`
	IsDelete      int    `json:"isDelete"`
	CardId        int    `json:"cardId"`
	RuleId        int    `json:"ruleId"`
	GroupStr      string `json:"groupStr"`
	IsChoose      bool   `json:"isChoose"`
	Children      []Group
}

func parseGroups(groups []Group, parentNames string, result *[]string) {
	for _, group := range groups {
		currentName := fmt.Sprintf("%s->%s", parentNames, group.GroupName)
		if len(group.Children) == 0 {
			*result = append(*result, fmt.Sprintf("%s,%d", currentName, group.GroupId))
		} else {
			*result = append(*result, fmt.Sprintf("%s,%d", currentName, group.GroupId))
			parseGroups(group.Children, currentName, result)
		}
	}
}

